The Fixx - Are We Ourselves [promo].VOB



Very HQ rare promo music video. &quot;Are We Ourselves&quot; is a song from Phantoms, the third studio album by The Fixx, released in 1984. In addition to reaching #15 on the U.S. pop charts, became the band's first #1 single on the U.S. Mainstream Rock chart, staying at the summit for two weeks.

The Fixx are an English rock band formed in London in 1979. They are one of the few bands to have enjoyed significant success outside their country of origin, notably in the United States and Canada, yet remain almost unknown in their home land. The band is best known for their song &quot;One Thing Leads to Another&quot;, from their most successful album Reach the Beach in 1983. 

Their other hits include &quot;Red Skies&quot;, &quot;Stand or Fall&quot;, &quot;Saved by Zero&quot;, &quot;Sign of Fire&quot;, &quot;Are We Ourselves?&quot;, &quot;Secret Separation&quot;, &quot;Driven Out&quot;, &quot;How Much Is Enough?&quot; and &quot;Deeper and Deeper&quot;, which was featured on the soundtrack of Streets of Fire. &quot;A Letter to Both Sides&quot; appears on the Fletch soundtrack.

The Fixx are recording their 10th studio album &quot;Something Ahead of You&quot; due for release in April 2011.
